import React, {Component} from 'react';
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Container from "react-bootstrap/Container";

class CharacterEquipment extends Component {
    render() {
        const amuletOffset = 7;
        return (
            <React.Fragment>
                <Row className="justify-content-center">
                    <Col md={0}>
                        {this.renderImageWithDescription('helmet', 75)}
                    </Col>
                </Row>
                <Row className="justify-content-center">
                    <Col
                        lg={{offset: amuletOffset}} md={{offset: amuletOffset}} sm={{offset: amuletOffset}}
                        xl={{offset: amuletOffset}} xs={{offset: amuletOffset}}>
                        {this.renderImageWithDescription('amulet', 35)}
                    </Col>
                </Row>

                <Row className="justify-content-center">
                    <Col md="auto">
                        {this.renderImageWithDescription('weapon', 150)}
                    </Col>

                    <Col md="auto">
                        {this.renderImageWithDescription('armor', 155)}
                    </Col>

                    <Col md="auto">
                        {this.renderImageWithDescription('shield', 150)}
                    </Col>
                </Row>
            </React.Fragment>
        );
    }
}

export default CharacterEquipment;
